import React from "react";
import { useParams } from "react-router-dom";
import { getItem } from "../libs/getItems";
import { getProduct } from "../libs/getItems";

export default function ProductRender() {
  const id = useParams();
  const data = getItem(id._id);
  console.log(data);
  const listmodel = data.map((data) => {
    return data.modele;
  });
  return <div>bonjour {data.title}</div>;
}

export function ModelRender() {
  const id = useParams();
  const dataModel = getProduct(id._id).modele;
  console.log(dataModel);
  return <div>bonjour {dataModel[0].name}</div>;
}
